    (188,'Castillian Hot Chocolate','2017-02-20 15:06:36',12730,'Non alcoholic','Cocoa','http://www.thecocktaildb.com/images/media/drink/3nbu4a1487603196.jpg','Coffee mug',NULL,'Cocoa powder',NULL,NULL,NULL,NULL,NULL,NULL,'Sugar','Cornstarch','Water','Milk',NULL,NULL,NULL,NULL,'Shift the cocoa and sugar together into a medium-sized saucepan. Dissolve the cornstarch in the water, and stir into the cocoa and sugar until it is a smooth paste. Begin heating the mixture, stirring it with a whisk, and gradually pour in the milk. Continue stirring with the whisk as you bring the liquid to a simmer. Allow the chocolate to simmer for about 10 minutes, stirring often, until it is thick, glossy and completely smooth. Serve steaming hot in coffee mug. Serves six.','1/2 cup',' ',NULL,NULL,NULL,NULL,NULL,'1 cup','7 tsp','1/2 cup','1 qt',' ',' ',' ',' ',NULL),
