    (219,'Darkwood Sling','2016-09-01 09:41:43',14482,'Alcoholic','Soft Drink / Soda','http://www.thecocktaildb.com/images/media/drink/sxxsyq1472719303.jpg','Cocktail glass',NULL,'Cherry Heering',NULL,NULL,NULL,NULL,NULL,NULL,'Soda water','Orange juice','Ice',NULL,NULL,NULL,NULL,NULL,'There are many good cherry liqueurs you can use, but I prefere Heering. Add one share of the liqueur. Then you add one share of Soda. For a sour sling use Tonic (most people prefer the drink without Tonic). Afterwards you fill the glass with Orange Juice and ice cubes.','1 part',NULL,NULL,NULL,NULL,NULL,NULL,'1 part','1 part',' cubes',NULL,NULL,NULL,NULL,NULL,NULL),
