    (221,'Diesel','2016-02-03 15:20:52',13128,'Alcoholic','Beer','http://www.thecocktaildb.com/images/media/drink/sxrrqq1454512852.jpg','Pint glass',NULL,'Lager',NULL,NULL,NULL,NULL,NULL,NULL,'Cider','Blackcurrant cordial',NULL,NULL,NULL,NULL,NULL,NULL,'Pour the lager first then add the blackcurrant cordial. Top up with the cider. The colour sholud be very dark approaching the colour of Guiness.','1/2 pint',NULL,NULL,NULL,NULL,NULL,NULL,'1/2 pint','1 dash',' ',' ',' ',' ',' ',NULL,NULL),
    (222,'Dirty Martini','2017-01-22 11:08:20',17181,'Alcoholic','Cocktail','http://www.thecocktaildb.com/images/media/drink/vcyvpq1485083300.jpg','Cocktail glass','New Era Drinks','Vodka',NULL,NULL,NULL,NULL,NULL,NULL,'Dry Vermouth','Olive Brine','Lemon','Olive',NULL,NULL,NULL,NULL,'Pour the vodka, dry vermouth and olive brine into a cocktail shaker with a handful of ice and shake well.Rub the rim of a martini glass with the wedge of lemon.Strain the contents of the cocktail shaker into the glass and add the olive.A dirty Martini contains a splash of olive brine or olive juice and is typically garnished with an olive.','70ml/2fl oz',NULL,NULL,NULL,NULL,NULL,NULL,'1 tbsp','2 tbsp','1 wedge','1',NULL,NULL,NULL,NULL,NULL),
