    (225,'Dragonfly','2017-09-02 22:51:40',11320,'Alcoholic','Ordinary Drink','http://www.thecocktaildb.com/images/media/drink/lnvbip1504389100.jpg','Highball glass',NULL,'Gin',NULL,NULL,NULL,NULL,NULL,NULL,'Ginger ale','Lime',NULL,NULL,NULL,NULL,NULL,NULL,'In a highball glass almost filled with ice cubes, combine the gin and ginger ale. Stir well. Garnish with the lime wedge.','1 1/2 oz',NULL,NULL,NULL,NULL,NULL,NULL,'4 oz','1',' ',' ',' ',' ',' ',NULL,NULL),
    (226,'Drinking Chocolate','2017-02-20 15:06:13',12736,'Non alcoholic','Cocoa','http://www.thecocktaildb.com/images/media/drink/u6jrdf1487603173.jpg','Coffee mug',NULL,'Heavy cream',NULL,NULL,NULL,NULL,NULL,NULL,'Milk','Cinnamon','Vanilla','Chocolate','Whipped cream',NULL,NULL,NULL,'Heat the cream and milk with the cinnamon and vanilla bean very slowly for 15-20 minutes. (If you don''t have any beans add 1-2 tsp of vanilla after heating). Remove the bean and cinnamon. Add the chocolate. Mix until fully melted. Serve topped with some very dense fresh whipped cream. Serves 1-2 depending upon how much of a glutton you are. For a richer chocolate, use 4 oz of milk, 4 oz of cream, 4 oz of chocolate. Serve in coffee mug.','2 oz',' ',' ',NULL,NULL,NULL,NULL,'6-8 oz','1 stick','1','2 oz finely chopped dark','Fresh ',' ',' ',' ',NULL),
    (227,'Dry Rob Roy',NULL,11324,'Alcoholic','Ordinary Drink','http://www.thecocktaildb.com/images/media/drink/typuyq1439456976.jpg','Cocktail glass',NULL,'Scotch',NULL,NULL,NULL,NULL,NULL,NULL,'Dry Vermouth','Lemon peel',NULL,NULL,NULL,NULL,NULL,NULL,'In a mixing glass half-filled with ice cubes, combine the Scotch and vermouth. Stir well. Strain into a cocktail glass. Garnish with the lemon twist.','2 1/2 oz',NULL,NULL,NULL,NULL,NULL,NULL,'1 1/2 tsp','1 twist of',' ',' ',' ',' ',' ',NULL,NULL),
