    (229,'Duchamp''s Punch','2017-01-22 11:31:25',17182,'Alcoholic','Cocktail','http://www.thecocktaildb.com/images/media/drink/g51naw1485084685.jpg','Old-fashioned glass',NULL,'Pisco',NULL,NULL,NULL,NULL,NULL,NULL,'Lime Juice','Pineapple Syrup','St. Germain','Angostura Bitters','Pepper','Lavender',NULL,NULL,'Shake all ingredients.Double strain in a chilled double old fashioned glass with abig ice cube.Garnish with a couple of lavender sprigs','5 cl',NULL,NULL,NULL,NULL,NULL,NULL,'2.5 cl','2.5 cl','1.5 cl','2 Dashes','Pinch','2 sprigs',NULL,NULL,NULL),
    (230,'Egg Cream','2017-01-14 21:47:26',12668,'Non alcoholic','Other/Unknown','http://www.thecocktaildb.com/images/media/drink/mvis731484430445.jpg','Coffee mug',NULL,'Chocolate syrup',NULL,NULL,NULL,NULL,NULL,NULL,'Milk','Soda water',NULL,NULL,NULL,NULL,NULL,NULL,'Mix syrup and milk in a fountain glass. Add soda water, serve with a straw.','2 tblsp',NULL,NULL,NULL,NULL,NULL,NULL,'6 oz whole','6 oz',' ',' ',' ',' ',' ',NULL,NULL),
    (231,'Egg Nog #4','2016-07-18 22:02:27',12910,'Optional alcohol','Punch / Party Drink','http://www.thecocktaildb.com/images/media/drink/wpspsy1468875747.jpg','Punch bowl',NULL,'Egg yolk','Sugar','Nutmeg',NULL,NULL,NULL,NULL,'Sugar','Milk','Light rum','Bourbon','Vanilla extract','Salt','Whipping cream','Egg white','In a small mixer bowl beat egg yolks till blended. Gradually add 1/4 cup sugar, beating at high speed till thick and lemon colored. Stir in milk, stir in rum, bourbon, vanilla, and salt. Chill thoroughly. Whip cream. Wash beaters well. In a large mixer bowl beat egg whites till soft peaks form. Gradually add remaining 1/4 cup sugar, beating to stiff peaks. Fold yolk mixture and whipped cream into egg whites. Serve immediately. Sprinkle nutmeg over each serving. Serve in a punch bowl or another big bowl. NOTE: For a nonalcoholic eggnog, prepare Eggnog as above, except omit the bourbon and rum and increase the milk to 3 cups.','6','1/4 cup','Ground ',' ',' ',' ',' ','1/4 cup','2 cups','1/2 cup','1/2 cup','1 tsp','1/4 tsp','1 cup','6',NULL),
    (232,'Egg Nog - Healthy','2016-07-18 21:55:08',12916,'Optional alcohol','Punch / Party Drink','http://www.thecocktaildb.com/images/media/drink/qxuppv1468875308.jpg','Collins Glass',NULL,'Egg',NULL,NULL,NULL,NULL,NULL,NULL,'Sugar','Condensed milk','Milk','Vanilla extract','Rum','Nutmeg',NULL,NULL,'Whip egg substitute and sugar together, combine with the two kinds of milk, vanilla, and rum. Mix well. Chill over night. Sprinkle with nutmeg. Makes 6 servings.','1/2 cup',NULL,NULL,NULL,NULL,NULL,NULL,'3 tblsp','13 oz skimmed','3/4 cup skimmed','1 tsp','1 tsp',NULL,NULL,NULL,NULL),
    (233,'Egg-Nog - Classic Cooked','2016-07-18 21:58:25',12914,'Optional alcohol','Punch / Party Drink','http://www.thecocktaildb.com/images/media/drink/quxsvt1468875505.jpg','Pitcher',NULL,'Egg',NULL,NULL,NULL,NULL,NULL,NULL,'Sugar','Salt','Milk','Vanilla extract',NULL,NULL,NULL,NULL,'In large saucepan, beat together eggs, sugar and salt, if desired. Stir in 2 cups of the milk. Cook over low heat, stirring constantly, until mixture is thick enough to coat a metal spoon and reaches 160 degrees F. Remove from heat. Stir in remaining 2 cups milk and vanilla. Cover and regfigerate until thoroughly chilled, several hours or overnight. Just before serving, pour into bowl or pitcher. Garnish or add stir-ins, if desired. Choose 1 or several of: Chocolate curls, cinnamon sticks, extracts of flavorings, flavored brandy or liqueur, fruit juice or nectar, ground nutmeg, maraschino cherries, orange slices, peppermint sticks or candy canes, plain brandy, run or whiskey, sherbet or ice-cream, whipping cream, whipped. Serve immediately.','6',' ',NULL,NULL,NULL,NULL,NULL,'1/4 cup','1/4 tsp','1 qt','1 tsp',' ',' ',' ',' ',NULL),
