    (239,'Flaming Lamborghini','2016-04-28 19:03:07',16485,'Alcoholic','Cocktail','http://www.thecocktaildb.com/images/media/drink/yywpss1461866587.jpg','Cocktail glass',NULL,'Kahlua',NULL,NULL,NULL,NULL,NULL,NULL,'Sambuca','Blue Curacao','Bailey''s irish cream',NULL,NULL,NULL,NULL,NULL,'Pour the Sambuca and Kahlua into the Cocktail Glass and give the drinker a straw. Pour the Baileys and Blue Curacao into two sepsrate shot glasses either side of the cocktail glass. Set light the concotion in the cocktail glass and start to drink through the straw (this drink should be drunk in one) , as the bottom of the glass is reached put out the fire by pouring the Baileys and Blue Curacao into the cocktail glass and keep drinking till it''s all gone!!','1 oz',NULL,NULL,NULL,NULL,NULL,NULL,'1 oz','1 oz','1 oz',' ',' ',' ',' ',' ',NULL),
