    (244,'Frappé','2015-09-03 03:05:28',12768,'Non alcoholic','Coffee / Tea','http://www.thecocktaildb.com/images/media/drink/vqwryq1441245927.jpg','Highball Glass',NULL,'Coffee',NULL,NULL,NULL,NULL,NULL,NULL,'Milk','Sugar',NULL,NULL,NULL,NULL,NULL,NULL,'Mix together. Blend at highest blender speed for about 1 minute. Pour into a glass and drink with a straw. Notes: This works best if everything is cold (if you make fresh coffee, mix it with the milk and let it sit in the fridge for 1/2 hour. If it is not frothy, add more milk, or even just some more milk powder. The froth gradually turns to liquid at the bottom of the glass, so you will find that you can sit and drink this for about 1/2 hour, with more iced coffee continually appearing at the bottom. Very refreshing.','1/2 cup black',NULL,NULL,NULL,NULL,NULL,NULL,'1/2 cup','1-2 tsp',' ',' ',' ',' ',' ',NULL,NULL),
