    (367,'Melya','2015-09-03 03:32:59',12776,'Non alcoholic','Coffee / Tea','http://www.thecocktaildb.com/images/media/drink/xwtptq1441247579.jpg','Coffee mug',NULL,'Espresso',NULL,NULL,NULL,NULL,NULL,NULL,'Honey','Cocoa powder',NULL,NULL,NULL,NULL,NULL,NULL,'Brew espresso. In a coffee mug, place 1 teaspoon of unsweetened powdered cocoa, then cover a teaspoon with honey and drizzle it into the cup. Stir while the coffee brews, this is the fun part. The cocoa seems to coat the honey without mixing, so you get a dusty, sticky mass that looks as though it will never mix. Then all at once, presto! It looks like dark chocolate sauce. Pour hot espresso over the honey, stirring to dissolve. Serve with cream.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Unsweetened ',' ',' ',' ',' ',' ',NULL,NULL,NULL),
