    (499,'Thai Coffee','2015-09-03 03:23:45',12782,'Non alcoholic','Coffee / Tea','http://www.thecocktaildb.com/images/media/drink/wquwxs1441247025.jpg','Highball glass',NULL,'Coffee',NULL,NULL,NULL,NULL,NULL,NULL,'Coriander','Cardamom','Sugar','Whipping cream','Ice',NULL,NULL,NULL,'Place the coffee and spices in the filter cone of your coffee maker. Brew coffee as usual, let it cool. In a tall glass, dissolve 1 or 2 teaspoons of sugar in an ounce of the coffee (it''s easier to dissolve than if you put it right over ice). Add 5-6 ice cubes and pour coffee to within about 1 inch of the top of the glass. Rest a spoon on top of the coffee and slowly pour whipping cream into the spoon. This will make the cream float on top of the coffee rather than dispersing into it right away.','6 tblsp ground',NULL,NULL,NULL,NULL,NULL,NULL,'1/4 tsp','4-5 whole green',NULL,NULL,NULL,NULL,NULL,NULL,NULL);
