    (500,'Thai Iced Coffee','2015-09-03 03:00:50',12784,'Non alcoholic','Coffee / Tea','http://www.thecocktaildb.com/images/media/drink/rqpypv1441245650.jpg','Highball glass',NULL,'Coffee',NULL,NULL,NULL,NULL,NULL,NULL,'Sugar','Cream','Cardamom',NULL,NULL,NULL,NULL,NULL,'Prepare a pot of coffee at a good European strength. In the ground coffee, add 2 or 3 freshly ground cardamom pods. Sweeten while hot, then cool quickly. Serve in highball glass over ice, with cream. To get the layered effect, place a spoon atop the coffee and pour the milk carefully into the spoon so that it floats on the top of the coffee.','black',NULL,NULL,NULL,NULL,NULL,NULL,NULL,' pods',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
