    (512,'Vampiro','2017-09-02 18:44:06',17217,'Alcoholic','Ordinary Drink','http://www.thecocktaildb.com/images/media/drink/yfhn371504374246.jpg','Old-Fashioned glass','New Era Drinks','Tequila',NULL,NULL,NULL,NULL,NULL,NULL,'Tomato Juice','Orange Juice','Lime Juice','Sugar Syrup','Salt',NULL,NULL,NULL,'Vampiros may be made in a tall glass or an old fashioned glass. Bartenders may first "rim" the glass with Kosher Salt, which is done by placing a layer of Kosher Salt on a chopping board, moistening the glass'' rim with lime juice or water, and then placing the upside down glass rim onto the Kosher Salt, so that the salt sticks to the moistened rim. The second step is to fill half the glass with ice and add one or two shooter glasses full of high quality Tequila. The next stage is to add the flavouring elements. This is done by squeezing a fresh lime into the glass, adding a few grains of salt, adding citrus-flavoured soda pop, until the glass is 4/5 full, and then adding spicy Viuda de Sanchez (or orange juice, lime juice and pico de gallo). The final step is to stir the ingredients so that the flavours are properly blended.','6 cl',NULL,NULL,NULL,NULL,NULL,NULL,'3 cl','3 cl','1.5 cl','1 dash','1 pinch',' ',NULL,NULL,NULL),
